import React from "react";

function Scrollbar() {

    const scroll = document.body;

    scroll.addEventListener("scroll", handleScroll);

    function handleScroll(event) {
        console.log(event);
    }

    return (
        <div className="scrollbar" onScroll={handleScroll}></div>
    );
}

export default Scrollbar;
